import React, { useState, useMemo} from 'react';
import './projectcontact.css';
import Select from 'react-select';
import countryList from 'react-select-country-list'
// import { useHistory } from 'react-router-dom'


function Projectcontact() {
    const [value, setValue] = useState('')
    const options = useMemo(() => countryList().getData(), [])

    const changeHandler = value => {
        setValue(value)
        // setUser({
        //     ...fill_details,
        //     'country': value['label']
        // })
    }

    return (
        <>
        <div className="projectcontact-main">
            <button className="projectcontact-btn"><a href="#main-container-Wrapper-ContactUs-Page">Get to contact page</a></button>
        </div>



<div className="address-main-container-Wrapper-form-Location">
            <div className="contactusformdivmaincontainer">

                <p className="contactformParaHead"> leave us a message</p>
                <div className="contactusformdiv">
                <div className="maincontactform">
                {/* <form> */}
                    <div className="fromnamediv">
                    <div>
                     
                    <input type='text' className='contactinput' id='fname' name="firstname"
                    //  value={user.firstname} onChange={handleChange} 
                     placeholder='First Name*' required />
                    </div>
                    <div>
            
                    <input type='text' className='contactinput' id='lname' name="lastname" 
                    // value={user.lastname} onChange={handleChange} 
                    placeholder='Last Name*' required />
                    </div>
                    </div>

                    <div className="fromcontactdiv">
                    <div>
                   
                    <input type='text' className='contactinput' id='contact' name="contactno" 
                    // value={user.contactno} onChange={handleChange}
                     placeholder='Contact Number*' required />
                    </div>
                    <div>

                    <input type='text' className='contactinput' id='email' name="email"
                    //  value={user.email} onChange={handleChange} 
                     placeholder='Email Address*' required />
                    </div>
                    </div>


                    <div>
                        <label htmlFor='country' className='hiringLabel'>Where Are You From *</label><br />
                        <Select options={options} value={value} onChange={changeHandler}   />
                    </div>

                    <div className="message-div">
            
                    <textarea rows="5" cols="69" className='contactmessagetextarea' name="message" id='message'
                    //  value={user.message} onChange={handleChange}  
                     placeholder='Message*'
                    required />
                    </div>
                    
                    <div className='btndiv'>
                        <button className='submitbtn'
                        //  onClick={submitform} 
                         value="submit">Submit</button>
                    </div>
                    
                    </div>
                    </div>
                    </div>
                    
                      
                {/* </form> */}

                </div>
          </>      
            
    )


}

export default Projectcontact;
